import React from 'react'

function Home () {
  const [datas, setDatas] = useState([]);

    useEffect(() => {
      fetch('http://localhost:4000/questions', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        }
      })
      .then(response => response.json())
      .then((data) => setDatas([data]))
      }, []);

    return (
      <div>
      <h3>Home</h3>
      <p>{datas}</p>
      </div>
    )
}

export default Home
